import React, {useState, useEffect, useRef} from "react";
import { useHistory } from "react-router-dom";
// import ColoredInImage from "./images/coloredInImage";
import Stitch from "../images/stitch.js";
import Ariel from "../images/ariel.js";
import Minnie from "../images/minnie";
import Cheshire from "../images/cheshireCat.js";
import R2D2 from "../images/r2d2.js";
import Yoda from "../images/yoda.js";
import Pooh from "../images/pooh.js";
export default function ColoredInImage(props) {
    const[image, setImage] = useState({});

    useEffect(() => {
        setImage(props)
    }, [props])

    return(
        <>
            {image.component === "stitch" ? <Stitch size={props.size} onFill={image.onFill} fillColors={image.fillColors} /> :
            image.component === "ariel" ? <Ariel size={props.size} onFill={image.onFill} fillColors={image.fillColors} /> :
            image.component === "r2d2" ? <R2D2 size={props.size} onFill={image.onFill} fillColors={image.fillColors} /> :
            image.component === "cheshire" ? <Cheshire size={props.size} onFill={image.onFill} fillColors={image.fillColors} /> :
            image.component === "yoda" ? <Yoda size={props.size} onFill={image.onFill} fillColors={image.fillColors} /> :
            image.component === "minnie" ? <Minnie size={props.size} onFill={image.onFill} fillColors={image.fillColors} /> :
            image.component === "pooh" ? <Pooh size={props.size} onFill={image.onFill} fillColors={image.fillColors} /> :
            <>Not Available</> }       
        </>
    )
}
